import React from 'react'

export default function SingleRecipe(recipe) {
  return (
    <div>
      <h4></h4>
      <figure><img src={`${recipe.recipe.image}`} alt="" /></figure>
      <button>Add</button>
      <button>More</button>
    </div>
  )
}
